import React,{useState,useEffect} from 'react';
import SucursalesDataServices from '../../services/sucursales';

const RestauranteLista = props => {
    const [restaurantes, setRestaurantes] = useState([]); 

    useEffect(()=>{
        obtenerSucursales();
    }, []);

    const obtenerSucursales = ()=>{
        SucursalesDataServices.getAll()
                  .then(response =>{
                    setRestaurantes(response.data.restaurantes);
                  })
                  .catch(e=>{
                    console.log(e);
                  });
    }

    return (
        <div >
          {restaurantes.map((sucursal) =>{
              const valoracion = `${sucursal.valoracion} estrellas`
              return (
                <div>
                    <h1>{sucursal.nombre}</h1>
                    <p>{valoracion}</p>
                </div>
              )
          })
          } 
        </div>
    )
}

export default RestauranteLista;
